import axios from "../axios.js";

const AuthAPI = {
    signUp: async (userData) => {
        try {
            const res = await axios.post(`/sign-up`, { ...userData });

            if (res.status === 0) {
                return res.data;
            }

            return false;
        } catch (err) {
            console.log(err);
            return false;
        }
    },
};

export default AuthAPI;
